CREATE TABLE IF NOT EXISTS `irsp_maps_range` (
  `rangeid` smallint(4) unsigned NOT NULL,
  `cityid` smallint(3) unsigned NOT NULL,
  `title` varchar(100) CHARACTER SET latin1 NOT NULL,
  `latitude` varchar(30) CHARACTER SET latin1 NOT NULL DEFAULT '0',
  `longitude` varchar(30) CHARACTER SET latin1 NOT NULL DEFAULT '0',
  `zoomlevel` tinyint(2) unsigned NOT NULL DEFAULT '5',
  `polygon` mediumtext CHARACTER SET latin1 NOT NULL,
  `color` varchar(7) CHARACTER SET latin1 NOT NULL DEFAULT '#000000',
  `dbcount` int(10) unsigned NOT NULL DEFAULT '0',
  `active` tinyint(1) unsigned NOT NULL DEFAULT '0'
) ENGINE=MyISAM AUTO_INCREMENT=1250 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci COMMENT='Iran SMS Panel''s Maps City Ranges';

